1) ұлттық валютаны және (немесе) шетел валютасын репатриациялау талабын орындамағаны үшін әкімшілік және қылмыстық жауаптылықтың болуы; 
 2) экспорт немесе импорт жөніндегі валюталық шарт бойынша есепке алу нөмірін алу және ол бойынша ақпарат, құжаттар мен есептер беру тәртібін бұзғаны үшін әкімшілік жауаптылықтың болуы.

 Есептік нөмірі бар экспорт немесе импорт жөніндегі валюталық шарт бойынша міндеттемелердің орындалуы туралы ақпаратты басқа уәкілетті банкке (оның филиалына) немесе ҚР ҰБ аумақтық филиалына (басқа уәкілетті банктен (оның филиалынан) немесе Қазақстан Республикасы Ұлттық Банкінің аумақтық филиалына беруге және (немесе) алуға келісемін.

Топтама бойынша қалдықтар келесі кезеңге көшірілмейді және болашақ төлемдер есебіне есептелмейді, оның ішінде:

• “Стандарт” тарифіне көшу;

• топтамадағы қызметтер жиынтығының өзгеруі;

• қызмет көрсету мерзімі өткенге дейін шоттарды жабу жағдайларында.


Лимиттер қосылған күннен бастап бір ай ішінде қолданылады. Қаласаңыз, топтаманың құрамын өзгертіңіз, жаңасын есептен шығару күніне дейін 1-2 күн бұрын қосуды ұсынамыз.


"Қолма-қол ақша алу және енгізу" опциясы теңгемен қолма-қол ақша көлемін көздейді.

Төлемге қол қою арқылы мен:

• уәкілетті банкке осы төлем және (немесе) ақша аударымы туралы ақпаратты Қазақстан Республикасының құқық қорғау органдарына және (немесе) Ұлттық Банкке ұсынуды рұқсат етемін;

• осы төлем және (немесе) ақша аударымы есептік нөмір алуды талап ететін валюталық шартты орындаумен байланысты еместігін растаймын;

• осы төлем және (немесе) ақша аударымы террористік немесе экстремистік әрекетті қаржыландырумен және терроризм немесе экстремизмге басқа жолмен көмек көрсетумен байланысты еместігін растаймын.

Бұл төлемді төмендегі арнаулы салық режимдеріндегі (АСР) микро- және шағын кәсіпкерлік субъектілері қолдана алады:
 • оңайлатылған декларация негізіндегі АСР;
 • шаруа немесе фермер қожалықтарына арналған АСР;
 • ауыл шаруашылығы өнімдерін өндірушілерге және ауыл шаруашылығы кооперативтеріне арналған АСР.

Бірыңғай төлем қызметкерлердің табысынан төленетін салықтар мен жарналарға балама ретінде қолданылады. Оның құрамына ЖТС, МЗЖ, ӘА, МӘМС, МӘМСЖ кіреді.
